    MovementComponent.prototype.createReimburseMovement = function (base) {
        var _this = this;
        var ACCOUNT_FOR_REIMBURSE = "11";
        var REIMBURSE_CATEGORY = "mct20190427225032-314918153583";
        var REIMBURSE_50 = "reimburse-50";
        var REIMBURSE_100 = "reimburse-100";
        var newAmount = base.mov_amount;
        var descPrefix = "";
        var descSufix = "";
        var reimburseType = "";
        var budget = base.mov_budget || "";
        if (budget.includes(REIMBURSE_50)) {
            reimburseType = REIMBURSE_50;
            newAmount = base.mov_amount * 0.5;
            descPrefix = "Half for: ";
            descSufix = ", original amount: " + common_1.formatCurrency(base.mov_amount, "en", "$");
        }
        if (budget.includes(REIMBURSE_100)) {
            reimburseType = REIMBURSE_100;
            newAmount = base.mov_amount;
            descPrefix = "Reimburse for: ";
        }
        // if no reimburse was detected, do nothing
        if (!reimburseType) {
            return false;
        }
        var reimburse = new Movement_1.Movement(base);
        reimburse.mov_desc = "" + descPrefix + base.mov_desc + descSufix;
        reimburse.mov_amount = newAmount;
        reimburse.mov_ctg_type = 2;
        reimburse.mov_id_account = ACCOUNT_FOR_REIMBURSE;
        reimburse.mov_txt_account = this.viewData.accounts.find(function (acc) { return acc.acc_id === ACCOUNT_FOR_REIMBURSE; }).acc_name;
        reimburse.mov_id_category = REIMBURSE_CATEGORY; // 'Rembolsos' Reimburse category
        reimburse.mov_txt_category = this.viewData.categories.find(function (cat) { return cat.mct_id === REIMBURSE_CATEGORY; }).mct_name; // 'Rembolsos' Reimburse category
        reimburse.mov_budget = base.mov_budget.replace(REIMBURSE_50, "");
        // new movement
        this.services.movement.newItem(reimburse, function () {
            return _this.retrieveAccountsAndBalance();
        });
        reimburse["isNew"] = true; // flag to render as new on UI
        console.log("this is the reimburse movement", reimburse);
        this.viewData.movements.unshift(reimburse);
        this.viewData.movements = this.viewData.movements.sort(function (a, b) {
            return new Date(a.mov_date).getTime() >= new Date(b.mov_date).getTime()
                ? -1
                : 1;
        });
        // Entries
        var localEntries = [];
        localEntries = this.generateEntriesForMovement(reimburse);
        console.log("these are all entries", this.services.entry.list);
        // add to balance
        this.services.balance.add(localEntries);
        console.log("these are all balance", this.services.balance.list);
    };
