    TasksComponent.prototype.commandOnTask = function (t, event) {
        var _this = this;
        if (t.tsk_name !== event.target["textContent"]) {
            this.updateTask(t.tsk_id, {
                tsk_name: event.target["textContent"]
            });
        }
        var command = event.target["textContent"];
        var originalTask = "";
        if (command.indexOf("--") !== -1) {
            // postpone
            command = command.substring(command.indexOf("--") + 2);
            originalTask = t.tsk_name.replace(" --" + command, "");
            console.log("command:", command);
            if (command.startsWith("pos")) {
                // --pos 17:30
                // --pos now +2h30m
                // --pos tomorrow 09:00
                // --pos 2016-12-31 23:59
                var data = command.substring(4);
                var s = this.services.tasksCore.parseDatetime(data);
                console.log("date parsed:", s);
                this.updateTask(t.tsk_id, {
                    tsk_name: originalTask,
                    tsk_date_view_until: s.date_start
                });
                this.updateState();
            }
        }
        if (command.startsWith("->[")) {
            // move to other record
            command = command.substring(command.indexOf("->[") + 3, command.indexOf("]", command.indexOf("->[") + 3));
            originalTask = t.tsk_name.replace("->[" + command + "] ", "");
            originalTask = t.tsk_name.replace("->[" + command + "]", "");
            console.log("command new list:", command);
            if (command) {
                this.updateTask(t.tsk_id, {
                    tsk_name: originalTask,
                    tsk_id_record: command
                });
                this.updateState();
            }
        }
        if (command.indexOf("%[") !== -1) {
            // set schedule
            var endPosition = command.indexOf("]", command.indexOf("%[")) === -1
                ? command.length
                : command.indexOf("]", command.indexOf("%["));
            command = command.substring(command.indexOf("%[") + 2, endPosition);
            var s = this.services.tasksCore.parseDatetime(command);
            originalTask = t.tsk_name.replace("%[" + command + "] ", "");
            originalTask = t.tsk_name.replace(" %[" + command + "]", "");
            originalTask = t.tsk_name.replace("%[" + command + "]", "");
            this.updateTask(t.tsk_id, {
                tsk_name: originalTask,
                tsk_schedule_date_start: s.date_start,
                tsk_schedule_date_end: s.date_end,
                tsk_estimated_duration: s.duration
            });
            this.updateState();
        }
        if (command.indexOf("#[") !== -1) {
            // set schedule
            var endPosition = command.indexOf("]", command.indexOf("#[")) === -1
                ? command.length
                : command.indexOf("]", command.indexOf("#["));
            command = command.substring(command.indexOf("#[") + 2, endPosition);
            originalTask = t.tsk_name.replace("#[" + command + "] ", "");
            originalTask = t.tsk_name.replace(" #[" + command + "]", "");
            originalTask = t.tsk_name.replace("#[" + command + "]", "");
            this.updateTask(t.tsk_id, {
                tsk_name: originalTask,
                tsk_tags: command
            });
            this.updateState();
        }
        if (command.indexOf("http://") !== -1) {
            // set url
            this.services.tasksCore.doThisWithAToken(t, function (t, expression) {
                //t.tsk_url = 'http://' + expression;
                _this.updateTask(t.tsk_id, {
                    tsk_name: t.tsk_name,
                    tsk_url: "http://" + expression
                });
                _this.updateState();
            }, "http://");
        }
        if (command.indexOf("https://") !== -1) {
            // set url
            this.services.tasksCore.doThisWithAToken(t, function (t, expression) {
                //t.tsk_url = 'https://' + expression;
                _this.updateTask(t.tsk_id, {
                    tsk_name: t.tsk_name,
                    tsk_url: "https://" + expression
                });
                _this.updateState();
            }, "https://");
        }
        // token to look up and method that returns the changes to apply
        // * important: remember these tokens apply just one at a time
        // and it should be the last thing in the task name to work properly
        var tokens = {
            "[-LINK]": function (t) { return ({
                // remove url link
                tsk_name: t.tsk_name,
                tsk_url: null
            }); },
            "[-SCHEDULE]": function (t) { return ({
                // remove schedule
                tsk_name: t.tsk_name,
                tsk_schedule_date_start: null,
                tsk_schedule_date_end: null
            }); },
            "[-TAGS]": function (t) { return ({
                // remove tags
                tsk_name: t.tsk_name,
                tsk_tags: ""
            }); },
            "[-QUALIFIERS]": function (t) { return ({
                // remove qualifiers
                tsk_name: t.tsk_name,
                tsk_qualifiers: ""
            }); }
        };
        // Iterate tokens and apply changes
        Object.keys(tokens).forEach(function (token) {
            if (command.indexOf(token) !== -1) {
                _this.services.tasksCore.doThisWithAToken(t, function (t, expression) {
                    _this.updateTask(t.tsk_id, tokens[token](t));
                    _this.updateState();
                }, token);
            }
        });
    };
